$(document).ready(function() {
  
  $('.dropdown-toggle').click(function(e) {
    e.preventDefault();
    setTimeout($.proxy(function() {
      if ('ontouchstart' in document.documentElement) {
        $(this).siblings('.dropdown-backdrop').off().remove();
      }
    }, this), 0);
  });

  $('.btn-confirm').on('click', function(e) {
    e.preventDefault();

    var rediurl = $(this).attr('href');
    var btnaction = $(this).data("action");
    var title = $(this).data("title");
    var text = $(this).data("text");
    var okbtn = '<button class="alertable-ok" type="submit">'+$(this).data("okbtn")+'</button>';
    var cbtn = '<button class="alertable-cancel" type="button">'+$(this).data("cbtn")+'</button>';

    $.alertable.confirm(title, {prompt: text, okButton: okbtn, cancelButton: cbtn}).then(function() {
        if (rediurl) {
          window.location.href = rediurl;
        } else {
          $("#action").val(btnaction);
          $(".jak_form").submit();
        }
    }, function() {
      return false;
    });
  });
  $(function () {
    $('[data-toggle="tooltip"]').tooltip();
  });
});

$(document).on('click', '[data-toggle="lightbox"]', function(event) {
    event.preventDefault();
    $(this).ekkoLightbox();
});

